/* wikipedia.org - Ubuntu Gold                                                      */
/* by Agnelo de la Crotche - 04.15.2008  - http://www.unixversal.com                */
/* This is a green/gold redesigned Wikipedia for Ubuntu fans                        */
/*                                                                                  */
/* other Wikipedia styles based on the same rules set                               */
/* wikipedia.org - Black & silver       http://userstyles.org/styles/6044           */
/* wikipedia.org - Ubuntu coffee beans  http://userstyles.org/styles/6069           */
/* wikipedia.org - chameleon green      http://userstyles.org/styles/6080           */
/* wikipedia.org - Mandriva blue        http://userstyles.org/styles/6083           */
/* wikipedia.org - Mepis blue           http://userstyles.org/styles/6110           */
/* wikipedia.org - Fedora slate blue    http://userstyles.org/styles/6157           */
/*                                                                                  */
/* LCARS redesigned styles :                                                        */
/* Black Google in LCARS terminal               http://userstyles.org/styles/6738   */
/* Black Google in LCARS - supplemental         http://userstyles.org/styles/6906   */
/* wikipedia.or Start Trek LCARS terminal       http://userstyles.org/styles/6594   */
/* userstyles.org Star Trek LCARS redesigned    http://userstyles.org/styles/6510   */
/* Enjoy !                                                                          */
/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/

@-moz-document domain(wikipedia.org),
               domain(wikimedia.org),
               domain(wikinews.org),
               domain(wikibooks.org),
               domain(wikiquote.org),
               domain(wikiversity.org),
               domain(wikisource.org),
               domain(wiktionary.org){
/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/

:focus { outline: none !important}   /* don't outline focused objects */
* {background-color: transparent !important; border-color: #d2c29d !important}

/* enforce transparent bg */
html, .noprint, .vectorTabs, #simpleSearch, #content, #footer {background: transparent !important}

a{color: #472c0f !important}

/* enforce dark fg */
table.plainlinks {background-color: #562d0c !important}



/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* background */
/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/







/* solid  */
body{background: #af9459 !important}


#mw-panel.collapsible-nav div.portal {background-image:url("data:image/png;base64,")!important}

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* links colors */

/* article body */
a:link{color: #5e2500 !important; font-weight: bold !important}
a:visited{color: #ffdb84 !important; font-weight: bold !important}
a:hover{color: #ffdb84 !important; text-decoration: none !important; font-weight: bold !important}

/* non existing pages */
a.new:link, a.new:visited{color: #d4320b !important}
a.new:hover{color: #b82209 !important}

/* tabs on user preferences page */
#preftoc a{color: #cfbd97 !important}
#preftoc a:hover{color: #fdc425 !important}
#preftoc li.selected a {color: #000000 !important}

/* wikitable */
.wikitable a:link{color: #7d3405 !important}
.wikitable a:visited{color: #e64f1a !important}
.wikitable a:hover{color: #e66a1a !important}

/* plainlinks */
.plainlinks a{color: #f8d17e !important; font-weight: normal !important}
.plainlinks a:hover{color: #ffffff !important; font-weight: normal !important}

/* catlinks */
#catlinks a{color: #f8d17e !important; font-weight: normal !important}
#catlinks a:hover{color: #ffffff !important; font-weight: normal !important} 

/* footer */
#footer a{color: #453105 !important;  font-weight: normal !important}
#footer a:hover{color: #efd3cc !important; font-weight: normal !important}

/* ambox/bandeau */
table.ambox a{color: #a32600 !important}
table.ambox a:hover{color: #ffffff !important; text-decoration: underline !important}
.bandeau a{color: #a32600 !important}
.bandeau a:hover{color: #ffffff !important; text-decoration: underline !important}
.bandeau-portail-texte a, .cadre_portail a{color: #a32600 !important}
.bandeau-portail-texte a:hover, .cadre_portail a:hover{color: #ffffff !important}

/* thumbnails caption */
.thumbinner a:link{color: #be9f9f !important; font-weight: normal !important}
.thumbinner a:visited{color: #fbae31 !important; font-weight: normal !important}
.thumbinner a:hover{color: #fbc231 !important; font-weight: normal !important}

/* specialchars */
#editpage-specialchars a, #mw-editTools a{color: #f9cf6b !important; font-weight: normal !important}
#editpage-specialchars a:hover, #mw-editTools a:hover{color: #ffffff !important; font-weight: normal !important}

/* message box */
.messagebox a{color: #f9cf6b !important; font-weight: normal !important}
.messagebox a:hover{color: #ffffff !important; font-weight: normal !important}

/* info box */
.infobox a{color: #773706 !important}
.infobox a:hover{color: #ffdb84 !important}
 
/* new article - anonymous login */
.permissions-errors a, .mw-newarticletextanon a{color: #f8d17e !important; font-weight: normal !important}
.permissions-errors a:hover, .mw-newarticletextanon a:hover{color: #ffa937 !important; font-weight: normal !important}

/* new article - registered user */
.mw-newarticletext a, #noarticletext a{color: #f8d17e !important; font-weight: normal !important}
.mw-newarticletext a:hover, #noarticletext a:hover{color: #ffa937 !important; font-weight: normal !important}

/* copy warning */
#editpage-copywarn a{color: #f1e37d !important; font-weight: normal !important} 
#editpage-copywarn a:hover{color: #ffffff !important; font-weight: normal !important}

/* alternative links box */
.wikilien_alternatif a:link, .wikilien_alternatif a:visited{color: #ffdb84 !important}
.wikilien_alternatif a:hover{color: #ffffff !important}

/* subtitles */
#siteSub a, #contentSub a{color: #fea201 !important; font-weight: normal !important}
#siteSub a:hover, #contentSub a:hover{color: #fde20b !important; font-weight: normal !important} 

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/

/* borders and corners */
h1, .mw-headline, .infobox, .vcard{-moz-border-radius-topleft: 30px !important; -webkit-border-top-left-radius: 30px !important}
h1, .mw-headline, .infobox, .vcard, .catlinks{ -moz-border-radius-bottomleft: 30px !important; -webkit-border-bottom-left-radius: 30px !important}
h1, .mw-headline, .portlet h5{border: none !important}

/* personal toolbar */
#p-namespaces * { margin-left: 10px !important} 
#p-personal li a {color: #f3e097 !important} 
#p-personal li a:hover {color: #ffffff !important ; text-decoration: none !important}
#p-personal li {padding-right: 15px !important}
#pt-userpage, #pt-anonuserpage, #pt-login, #mw-panel.collapsible-nav div.portal h5 { background-image: url("data:image/png;base64,")!important; background-position: 0 3px !important}

/* top navbar */
#p-namespaces li, #p-views li {height: 1.5em !important; margin-top:9px !important}
div.vectorTabs {background-image: none !important}
div.vectorTabs * {background-image: none !important; padding-top: 3px !important ; margin-left: 2px !important}
div.vectorTabs ul li, div#p-cactions ul li {background-image: none !important; background: none !important; border: 1px solid #f8b331 !important; -moz-border-radius-topleft: 12px !important; -webkit-border-top-left-radius: 12px !important; -moz-border-radius-topright: 12px !important; -webkit-border-top-right-radius: 12px !important}
div#mv-head { width: 90% !important } 
div.vectorTabs ul li, div#p-cactions ul li {background-color: #d8c753 !important}
div.vectorTabs ul li:hover, div#p-cactions ul li:hover {background-color: #91741c !important}
div.vectorTabs ul li *, div#p-cactions ul li * { color: #000000 !important}
div.vectorTabs ul li.selected, div#p-cactions ul li.selected {background-color: #a8794b !important}
div.vectorTabs ul li.selected:hover, div#p-cactions ul li.selected:hover {background-color: #724223 !important}
div.vectorTabs ul li.selected *, div#p-cactions ul li.selected * {color: #000000 !important}
div#p-cactions ul li.selected {border-bottom: none !important}
div.vectorTabs ul {height: 30px !important}
div.vectorTabs ul li a span:hover, div#p-cactions ul li a:hover {text-decoration: none !important}
div.vectorTabs ul li *:hover, div#p-cactions ul li *:hover, div.vectorTabs ul li.selected *:hover, div#p-cactions ul li.selected *:hover {color: #ffffff !important}
/* search box */
#searchInput {background-color: #ebde66 !important}
#searchButton {display: none !important}
td.os-suggest-result, .suggestions-result {background-color: #f5bb36 !important}
td.os-suggest-result span, .suggestions-result span {color: #000000 !important}
td.os-suggest-result-hl, .suggestions-special, .suggestions-result-current {background-color: #681f1f !important}
td.os-suggest-result-hl span, .suggestions-result-current span {color: #ffffff !important}
.suggestions-special {background-color: #d8c753 !important}
.suggestions-special:hover {background-color: #681f1f !important; color: #ffffff !important}
.special-label {color: #000000 !important}
.special-label:hover {color: #ffffff !important}
#simpleSearch {border: none !important; background:none !important}
#simpleSearch input#searchInput {border: 1px solid #f8b331 !important; -moz-border-radius: 20px !important;  -webkit-border-radius: 20px !important}

/* left side bar */
#mw-panel a {color: #a21b07 !important}
#mw-panel a:hover {color: #ca2c0a !important}
#mw-panel h5 {color: #ffffff !important}
#mw-panel h5:hover {color: #ff0000 !important}
#mw-panel.collapsible-nav div.portal h5 { background-position: 0 8px !important}

/* content */
#content, .pBody, #footer {-moz-border-radius-topleft: 1em !important; -moz-border-radius-bottomleft: 1em !important; -webkit-border-top-left-radius: 1em !important; -webkit-border-bottom-left-radius: 1em !important; border-right : none !important; border-width: 5px !important}
#content { border: 1px solid #f8b331 !important; border-right: none !important}

.toc, textarea, .catlinks {-moz-border-radius-bottomright: 30px !important; -webkit-border-bottom-right-radius: 30px !important}
.toc{-moz-border-radius-topright: 30px !important; -webkit-border-top-right-radius: 30px !important; border-width: 4px !important}
.infobox, .vcard{border-width: 4px !important}
.thumb, .tleft, .tright {border-width: 0px !important}
.thumbinner {border-width: 1px !important; border-bottom-width: 20px !important; -moz-border-radius-bottomright: 20px !important; -webkit-border-bottom-right-radius: 20px !important}
.jsprefs, table.ambox, table.ambox-content, #mw-js-message, .bandeau{-moz-border-radius-topleft: 20px !important; -webkit-border-top-left-radius: 20px !important}
table.ambox, table.ambox-content, #mw-js-message, .bandeau{-moz-border-radius-bottomleft: 20px !important; -webkit-border-bottom-left-radius: 20px !important; border-collapse: separate !important; border-left-width: 20px !important}
.jsprefs, table.messagebox, #userloginForm form, #contributions-footer-box, #talkpagetext{-moz-border-radius-topright: 20px !important; -webkit-border-top-right-radius: 20px !important}
.jsprefs, table.messagebox, #userloginForm form, #contributions-footer-box{-moz-border-radius-bottomright: 20px !important; -webkit-border-bottom-right-radius: 20px !important}
.jsprefs, table.messagebox, #userloginForm form {border-collapse: separate !important; border-right-width: 20px !important; border-bottom-width: 10px !important}

#editpage-specialchars, .mw-editTools .plainlinks{-moz-border-radius-topright: 15px !important; -webkit-border-top-right-radius: 15px !important; border-collapse: separate !important; border-right-width: 15px !important; border-top-width: 15px !important}

div.permissions-errors * {border-color: transparent !important}
div.permissions-errors, div.mw-newarticletextanon {border: solid 2px !important}
div#mw-recreate-deleted-warn {border: double 2px #af0000 !important}
textarea{border: solid 2px #9e4d30 !important; padding-left: 5px !important; padding-right: 5px !important; width: 98.7% !important}
input{border: solid 1px #9e4d30 !important; padding-left: 5px !important}
input[type=text], input[type=password]{border: solid 1px #9e4d30 !important; padding-left: 10px !important; padding-right: 10px !important}
input[type=password]{border-color: #6c1210 !important}
pre{border-style: dotted !important; padding: 1em !important}
.navbox, .collapsible, .autocollapse, .nowraplinks {border-left-style: dotted !important; border-right-style: dotted !important}
.catlinks{border-width: 2px !important; border-bottom-width: 30px !important}
.cadre_portail, #bandeau-portail{border: none !important}

/* footer */
#footer {margin-top: 10px !important}

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/

table, pre{color: #000000 !important}
.thumb{border: none !important} 

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* buttons and input areas */

textarea{background-color: #dbcdad !important; color: #000000 !important;
  border-style: solid !important; border-color: #453105 #e4d3be #e4d3be #453105 !important}
input, select{background-color: #c3ad7c !important; color: #000000 !important;
  border-style: solid !important; border-color: #453105 #e4d3be #e4d3be #453105 !important} 
input[type=submit]{background-color: #85631b !important; color: #ffffff !important; 
  border-style: solid !important; border-color: #b08561 #453105 #453105 #b08561 !important}
input[type=text], input[type=password], select{background-color: #c3ad7c !important; color: #000000 !important; font-weight: normal !important;
  border-style: solid !important; border-color: #453105 #e4d3be #e4d3be #453105 !important} 

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* bullets - use Ubuntu coffee bean within unordered lists */

ul li{
list-style-image: url("data:image/png;base64,") !important} 

.toclevel-1, .toclevel-2, .toclevel-3, .toclevel-4, .toclevel-5, .toclevel-6{list-style-image: none !important}
ul#preftoc li{list-style-image: none !important}

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* coloring classes */
h1{color: #ffffff !important}
h2, h3, h4, h5, h6, .plainlinks{color: #ecdbcf !important}
table.wikitable, table.wikitable *{background-color: #d5c49f !important; border-color: #ffffff !important; color: #000000 !important}
table caption{background-color: #76592d !important; border: none !important}
pre{ 
  background-color: #d5c49f !important; 
  border-style: dotted !important; border-color: #8d5c1c !important; 
  padding: 1em !important}

.cquote td{color: #7c483b !important}
.thumbinner{background-color: #411e01 !important; color: #f59238 !important}
.infobox{background-color: #b9a06a !important; color: #000000 !important}
.noprint, .noprint td{color: #795a43 !important}
.messagebox{background-color: #94742f !important; color: #000000 !important}
.ambox, .bandeau{background-color: #c3ad7c !important; color: #000000 !important}
.cadre_portail, #bandeau-portail{background-color: #a08240 !important; color: #000000 !important}
.mw-newarticletextanon{background-color: #94742f !important}
.mw-newarticletext, .noarticletext{background-color: #9c7e3b !important}
.permissions-errors * {background-color: #b83d0d !important; color: #000000 !important}
#cpwarn{background-color: #c96868 !important; border-color: #ffffff !important}
.autocomment{color: #5c5651 !important}
.comment{color: #1a3e19 !important}
.prefsectiontip{color: #543b07 !important}

/* coloring other elements */
#bodyContent, #footer{color: #000000 !important}
#talkheader th{background-color: #433005 !important; color: #c8b487 !important}
#contributions-footer-box, #catlinks{background-color: #94742f !important; color: #000000 !important}
#talkpagetext{background-color: #a88b4d !important; color: #000000 !important}
#editpage-specialchars, .mw-editTools .plainlinks{background-color: #5d5034 !important; color: #000000 !important}
ul#preftoc li, #p-cactions li{background-color: #93815b !important}
ul#preftoc li.selected , #p-cactions li.selected{background-color: #a18241 !important}
#siteSub, #contentSub{color: #ecdbcf !important}
#footer{background-color: #948462 !important;  margin-bottom: 0px !important}
.wikilien_alternatif{background-color: #6c5f43 !important}

/* change some syntax highlighing unreadable colors */
.kw1{color: #af0000 !important}
.kw3{color: #5965be !important}
.nu0{color: #ff00ff !important}
.br0{color: #0d8e06 !important}
.coMULTI, .co1{color: #776b69 !important}

/* restoring white text color */
.mw-newarticletextanon *, .mw-newarticletext *, .noarticletext * {color: #ffffff !important}

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* provide a coloured background for some black on transparent images */
/* unfortunately you have to add them to the list below.              */
/* Giving a coloured background while using a black background looks awful */

img[src$="/250px-Singleton_UML_class_diagram.svg.png"]
{background-color: #ece58a !important}

/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* bullets - use Ubuntu coffee bean within unordered lists */

ul li{
list-style-image: url("data:image/png;base64,") !important}

ul#footer-info li, ul#footer-places li, ul#footer-icons li { list-style-image: none !important}

.toclevel-1, .toclevel-2, .toclevel-3, .toclevel-4, .toclevel-5, .toclevel-6{list-style-image: none !important}
ul#preftoc li{list-style-image: none !important} 


/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
/* wikipedia gold logo embedded */

#p-logo a{background: url("data:image/png;base64,") 35% 50% no-repeat !important}
/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */

}
